public static <T, X, E extends Throwable> Collection<X> map(Iterable<T> coll, AFunction1<? super T, ? extends X, E> f) throws E {
        final List<X> result = new ArrayList<>();

        for(T o: coll) {
            result.add(f.apply(o));
        }

        return result;
    }
